package com.koso.triplogger.modelimport androidx.annotation.Keepimport androidx.room.Entityimport androidx.room.PrimaryKey@Entity(tableName = "triplogger_trip_table")@Keepdata class Trip(    @PrimaryKey(autoGenerate = true)    var id: Long = 0,    val starttime: Long,    val endtime: Long,    val nodes: List<DataSet>,    val distance: Int,    val filename: String?,    var note: String,    //remote properties    var remoteid: String? = null,    var user: String? = null,    var reference: TripFileReference? = null)@Keepdata class TripFileReference(    val bucket: String,    val path: String)